import Layout from "hocs/layouts/Layout";
import Header from "components/navigation/home/Header";
function Home (){
    return(
        <Layout>
            <Navbar/>
            <div>
                <Header/>
            </div>

            <Footer/>
        </Layout>
    )
}
export default Home;
